item.value:
To be used by custom operators: invokes assembly {@link Hooks} pointcut given a
{@link Mono}, potentially returning a new {@link Mono}. This is for example useful
to activate cross-cutting concerns at assembly time, eg. a generalized
{@link checkpoint()}.

@param <T> the value type
@param source the source to apply assembly hooks onto

@return the source, potentially wrapped with assembly time cross-cutting behavior

Removes the mapping for the specified key from this map if present.

@param  key key whose mapping is to be removed from the map
@return the previous value associated with {@code key}, or
        {@code null} if there was no mapping for {@code key}.
        (A {@code null} return can also indicate that the map
        previously associated {@code null} with {@code key}.)

Allows setting the value of <code>hint<code> that is passed on to the LoadBalancer
request and can subsequently be used in {@link ReactiveLoadBalancer}
implementations.

@param fromIndex low endpoint (inclusive) of the subList
@param toIndex high endpoint (exclusive) of the subList
@return a view of the specified range within this list
@throws IndexOutOfBoundsException for an illegal endpoint index value
        ({@code fromIndex < 0 || toIndex > size ||
        fromIndex > toIndex})

Performs a <a href="package-summary.htmlReduction">reduction<a> on the
elements of this stream, using the provided identity value and an
<a href="package-summary.htmlAssociativity">associative<a>
accumulation function, and returns the reduced value.  This is equivalent
to:
<pre>{@code
    T result = identity;
    for (T element : this stream)
        result = accumulator.apply(result, element)
    return result;
}<pre>

but is not constrained to execute sequentially.

This will be used as the bean name instead of name if present, but will not be used
as a service id.
@return bean name instead of name if present
